import { useState } from "react";

function Empform() {
  const [id, setId] = useState("");
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [mobile, setMobile] = useState("");

  const changeid = (j) => {
    setId: (j.target.value)
  }
  const changename = (j) => {
    setName: (j.target.value)
  }
  const changeemail = (j) => {
    setEmail: (j.target.value)
  }
  const changemobile = (j) => {
    setMobile: (j.target.value)
  }
  const handlesubmit = () => {
    fetch("http://localhost:3006/employesdata")
  }

  return (
    <div>
      <form>
        <br></br>
        <div class="mb-3">
          <label for="exampleInputEmail1" class="form-label">
            id:-
          </label>
          <input
            value={id}
            type="number"
            class="form-control "
            id="exampleInputEmail1"
            aria-describedby="emailHelp"
            className="col-4"
            onChange={changeid}
          />
        </div>
        <div class="mb-3">
          <label for="exampleInputPassword1" class="form-label">
            name:-
          </label>
          <input
            value={name}
            type="text"
            class="form-control"
            className="col-4"
            onChange={changename}
          />
        </div>

        <div class="mb-3">
          <label for="exampleInputPassword1" class="form-label">
            email:-
          </label>
          <input
            value={email}
            type="email"
            class="form-control"
            className="col-4"
            onChange={changeemail}
          />
        </div>
        <div class="mb-3">
          <label for="exampleInputPassword1" class="form-label">
            mobile:-
          </label>
          <input
            value={mobile}
            type="tel"
            class="form-control"
            className="col-4"
            onChange={changemobile}
          />
        </div>
        <button type="submit" class="btn btn-primary">
          Submit
        </button>
      </form>
    </div>
  );
}
export default Empform;
